import React from 'react';
import { NavigationItem } from './navigation-item/NavigationItem';

export const NavigationItems = ({ link, isUserLoggedIn }) => {
  return (
    <ul>

      <NavigationItem
        link={ link }
        exact
      >
        {props.children}
      </NavigationItem>
      {isUserLoggedIn ?
        <NavigationItem
          link={ link }
        >
          {props.children}
      </NavigationItem>
        : null}
      {isUserLoggedIn ?
        <NavigationItem
          link='/auth'
        >
          
      </NavigationItem>
        : <NavigationItem
          link='/logout'
        >
          Logout
      </NavigationItem>}

    </ul>
  );
}
